INSERT INTO tb_vehicle (id, description, image_url,name,price,vehicle_brand,vehicle_fuel,vehicle_model,vehicle_type,model_year) VALUES (1,'O Audi A3 é um carro compacto premium com design elegante e esportivo. Possui motorização eficiente, com opções de motores a gasolina ou diesel, além de tecnologia de ponta como o sistema de tração integral quattro. O interior é sofisticado, com acabamentos em materiais de alta qualidade e tecnologia avançada. É um carro ideal para quem busca um veículo de alto desempenho e conforto, com um toque de luxo.', 'https://cdn.motor1.com/images/mgl/nRVvk/s1/audi-a3-sportback-2020-on-location.webp', 'A3', 156900, 'AUDI', 'GASOLINE', 'SEDAN', 'CAR', 2020)
INSERT INTO tb_vehicle (id, description, image_url,name,price,vehicle_brand,vehicle_fuel,vehicle_model,vehicle_type,model_year) VALUES (2,'O Volkswagen Gol 2019 é um carro popular com visual moderno e arrojado. Possui motor 1.0 ou 1.6, ambos com opções de transmissão manual ou automática, garantindo boa economia de combustível. O interior é simples e funcional, com espaço suficiente para cinco passageiros. Conta com tecnologias como direção elétrica, ar-condicionado e sistema de som completo. É uma opção para quem busca um carro acessível e confiável para o dia a dia.', 'https://3.bp.blogspot.com/-95DJdrDx5u4/WxwkG8wciOI/AAAAAAAAGFY/3xyInTHbjJwna_lRbIustBHx8H9wBiIHACLcBGAs/s1600/VW-Gol-2019%2B%25283%2529.JPG', 'Gol', 69100, 'VOLKSWAGEN', 'GASOLINE', 'SEDAN', 'CAR', 2019)
INSERT INTO tb_vehicle (id, description, image_url,name,price,vehicle_brand,vehicle_fuel,vehicle_model,vehicle_type,model_year) VALUES (4,'O Volkswagen Nivus 2022 é um SUV compacto com estilo moderno e motor turbo de 1.0 litro com transmissão automática de seis velocidades. O interior é espaçoso e confortável, com tecnologias avançadas como o painel digital Active Info Display e o sistema multimídia VW Play. É uma opção urbana com design inovador e alto nível de tecnologia, além de recursos de segurança como frenagem automática de emergência e alerta de ponto cego.', 'https://cdn.motor1.com/images/mgl/8wbyv/s1/vw-nivus-highline-2020-superteste.jpg', 'Nivus', 134500, 'VOLKSWAGEN', 'GASOLINE', 'SEDAN', 'CAR', 2022)
INSERT INTO tb_vehicle (id, description, image_url,name,price,vehicle_brand,vehicle_fuel,vehicle_model,vehicle_type,model_year) VALUES (5,'O Ford Mustang é um ícone automotivo que mistura estilo e desempenho. Com motor V8 de 5.0 litros ou EcoBoost de 2.3 litros, oferece potência e aceleração impressionantes. Possui recursos tecnológicos, como central multimídia de 12 polegadas, sistema de som premium e assistência de condução avançada. O porta-malas tem capacidade de 382 litros. É uma ótima escolha para quem busca um carro esportivo com muito estilo e desempenho.', 'https://revistacarro.com.br/wp-content/uploads/2020/02/Mustang_1.jpg', 'Mustang', 448872.99, 'FORD', 'GASOLINE', 'SEDAN', 'CAR', 2020)
INSERT INTO tb_vehicle (id, description, image_url,name,price,vehicle_brand,vehicle_fuel,vehicle_model,vehicle_type,model_year) VALUES (6,'O BMW M5 é um sedã esportivo de alto desempenho, com motor V8 de 4.4 litros e 600 cavalos de potência. Possui tração integral, transmissão automática de oito velocidades e suspensão adaptativa para uma direção precisa e confortável. Com recursos tecnológicos avançados, incluindo central multimídia de 12,3 polegadas, sistema de som premium e assistência de condução avançada, é um carro que oferece luxo e desempenho.', 'https://hips.hearstapps.com/hmg-prod/images/2024-bmw-m5-sedan-rendering-1676575610.jpg?crop=0.741xw:0.874xh;0.173xw,0.126xh&resize=640:*', 'M5', 1056950.67, 'BMW', 'GASOLINE', 'SEDAN', 'CAR', 2023)
INSERT INTO tb_vehicle (id, description, image_url,name,price,vehicle_brand,vehicle_fuel,vehicle_model,vehicle_type,model_year) VALUES (7,'O Mercedes A45 AMG é um hatch médio esportivo de alta performance, que tem como destaque seu poderoso motor M139, uma pequena usina de força com nada menos que 421 cavalos. Isso tudo em 2.0 litros, sendo o motor deste tipo com a maior potência por litro, mais de 210 cavalos ou 105,25 cavalos por cilindro.', 'https://car-images.bauersecure.com/wp-images/12184/mercedes-amg-a45-03.jpg', 'AMG A45', 256580.64, 'MERCEDES_BENZ', 'GASOLINE', 'SEDAN', 'CAR', 2017)
INSERT INTO tb_vehicle (id, description, image_url,name,price,vehicle_brand,vehicle_fuel,vehicle_model,vehicle_type,model_year) VALUES (8,'O Honda Civic Type R é um carro esportivo de alto desempenho com motor turbocharged de 2.0 litros e 306 cavalos de potência. Com suspensão ajustável, freios de alto desempenho e um diferencial de deslizamento limitado, o Type R é conhecido por sua excelente dirigibilidade e agilidade. Seu design aerodinâmico agressivo com grandes asas traseiras e difusor traseiro ajuda a melhorar a estabilidade em altas velocidades.', 'https://s2.glbimg.com/puOOv8bk464_9NDN_r6hfZRcPco=/1200x/smart/filters:cover():strip_icc()/i.s3.glbimg.com/v1/AUTH_cf9d035bf26b4646b105bd958f32089d/internal_photos/bs/2020/k/W/sDAbvPSEuwTma0BzX3hQ/2020-02-26-civic.jpg', 'Civic Type R', 675000, 'HONDA', 'GASOLINE', 'SEDAN', 'CAR', 2023)
INSERT INTO tb_vehicle (id, description, image_url,name,price,vehicle_brand,vehicle_fuel,vehicle_model,vehicle_type,model_year) VALUES (9,'O Nissan GT-R é um carro esportivo de alto desempenho que é conhecido por sua tecnologia avançada e capacidade de desempenho em altas velocidades. Ele é equipado com um motor turbocharged V6 de 3.8 litros que produz cerca de 565 cavalos de potência e possui tecnologia de tração nas quatro rodas e um sistema de transmissão automatizado de dupla embreagem.', 'https://hips.hearstapps.com/hmg-prod/images/2024-nissan-gt-r-119-1673621285.jpg?crop=0.655xw:0.873xh;0,0.0405xh&resize=640:*', 'GTR', 1253178, 'NISSAN', 'GASOLINE', 'SEDAN', 'CAR', 2023)
